window.bookSummaryJSON = "<p>The bowtie is back! </p> <p>Dre was just a beautiful stranger when Preppy saved her the first time around. Now, he has to save her again, but she's no longer some stranger, she's family, and he has no idea who or what he's up against. </p> <p>What he does know is that putting his family back together is the only acceptable outcome. </p> <p>Preppy's to-do list? </p> <p>Save family. Seek revenge. </p> <p>He's alive...and he's out for blood. </p> <p><i>Preppy: Part Three</i> is the third book and conclusion of Preppy and Dre's story. It's also the seventh book in the King Series. </p>"; 
